import React from "react";
// import {Link} from "react-router-dom";
import "../../../map.css";
import "./style.css";
import { PromiseProvider } from "mongoose";

function Index (props) {    

    let array = [];

    for (var i = 0; i < 26; i++) {
        array.push(<a className="index-link" value={String.fromCharCode(i + 65)} href={"/list/" + String.fromCharCode(i + 97)}
            onClick={props.setSelection}>{String.fromCharCode(i + 65)}</a>);
    }
    return (
        <div id="selectors">
            {array}
        </div>
    );
}

export default Index;

